import loginerr from '../images/loginerr.png';

function InfoTooltip(props) {
  return (
    <Popup isOpened={props.isOpened} onClose={''}>
      <img className="tooltip-img" src="" />
      <span className="tooltip-description">{''}</span>
    </Popup>
  );
}

export { InfoTooltip };
